import React, { Component } from "react";

const MovieComponent = (props) => {
    return (
        <div id='movieComponentId'>
            {props.moviedetails}

            {props.moviedetails.map((item) => {
                <img src={item.Poster} />
            })}



        </div>
    )
}
export default MovieComponent;
